import NavBar from "./components/navBar/NavBar.jsx"
import Formulario from "./components/formulario/Formulario.jsx"
import PageCadastros from "./pages/PageCadastros.jsx"
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  BrowserRouter as Router,
  Route,
  Switch,
} from 'react-router-dom';


function App() {
  return (
    <section>

      <NavBar />


      <Router>
        <Switch>
          <Route path="/cadastros" exact component={PageCadastros} />


        </Switch>


      </Router>

      <PageCadastros />



      <nav>
        <Formulario />
      </nav>



    </section>
  );
}

export default App;
